import React from 'react';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
  return (
    <div className="navbar-nav-scroll">
	<div>
          <NavLink to="/">Home</NavLink>
          <NavLink to="/about">About</NavLink>
          <NavLink to="/intro">Contact</NavLink>
       </div>
      <ul className="navbar-nav">
        <li className="nav-item active text-uppercase text-white">Documentation</li>
		<li className="nav-item active text-uppercase text-white">intro</li>
		<NavLink to="/intro">Contact</NavLink>
      </ul>
    </div>
  );
}
export default Navigation;
